import './personalDetails.css';
import 'font-awesome/css/font-awesome.min.css';

//<i className="fa fa-spinner fa-spin">no spinner but why</i>

const PersonalDetails = (props) => <div className="sideDetails"> 
    <i className="fa fa-phone-alt"> {props.details.Phone}  </i>
    <i className="fad fa-envelope"> {props.details.Email}  </i>
</div>;

export default PersonalDetails;
